// src/components/Header.js
import React from 'react';

const Header = () => (
  <header style={styles.header}>
    {/* Title with Logo in the Center */}
    <div style={styles.titleContainer}>
      <span style={styles.titleText}>UMMATI C</span>
      <img src="/assets/icons/logo.png" alt="Logo" style={styles.logo} />
      <span style={styles.titleText}>MMUNITY</span>
    </div>

    {/* Navigation Links */}
    <nav style={styles.navLinks}>
      <span style={styles.navItem}>Events</span>
      <span style={styles.navItem}>Podcast</span>
      <span style={styles.navItem}>Membership</span>
      <span style={styles.navItem}>Chapters</span>
      <span style={styles.navItem}>About</span>
      <span style={styles.navItem}>Contact</span>
    </nav>

    {/* Login Button */}
    <div style={styles.loginButton}>
      <span style={styles.loginButtonText}>Login</span>
    </div>
  </header>
);

const styles = {
  header: {
    display: 'flex',
    alignItems: 'center',
    justifyContent: 'space-between',
    background: 'white',
    padding: '10px 20px',
    width: '100%',
  },
  titleContainer: {
    display: 'flex',
    alignItems: 'center',
    gap: '10px',
  },
  titleText: {
    color: '#5A4283',
    fontSize: 32,
    fontFamily: 'Quicksand',
    fontWeight: 700,
    whiteSpace: 'nowrap',
  },
  logo: {
    width: 35,
    height: 35,
  },
  navLinks: {
    display: 'flex',
    gap: '20px',
  },
  navItem: {
    color: '#5A4283',
    fontSize: 16,
    fontFamily: 'Quicksand',
    fontWeight: 400,
    cursor: 'pointer',
    textAlign: 'center',
  },
  loginButton: {
    paddingLeft: 24,
    paddingRight: 24,
    paddingTop: 10,
    paddingBottom: 10,
    backgroundColor: '#78B27B',
    borderRadius: 40,
    display: 'flex',
    alignItems: 'center',
    justifyContent: 'center',
  },
  loginButtonText: {
    color: '#D9F4DA',
    fontSize: 16,
    fontFamily: 'Quicksand',
    fontWeight: 700,
    letterSpacing: 0.32,
    whiteSpace: 'nowrap',
  },
};

export default Header;
